                <Text>JOIN</Text>
            </TouchableOpacity>
  
        </SafeAreaView>  
    );
  }


function CustomerAdd({ navigation }) {
    return (
        <SafeAreaView style={styles.container}>
            <Text>Add Page</Text>
        </SafeAreaView>
    );
}



